import React from 'react';
import Head from "next/head";
import { Layout } from "../components";
import fetch from 'isomorphic-unfetch'

import '../styles/normalize.scss';
import '../styles/global.scss';

const HomePage = (articles) => {
  return (
    <Layout>
      <Head>
        <title>Welcome</title>
      </Head>
      <h1>Latest</h1>
      <section className='photo-grid-container'>
        <div className='photo-grid'>
          {Object.keys(articles).map(article => {
            return (
              <div key={article} className='photo-grid-item'>
                {articles[article].urlToImage && <img src={articles[article].urlToImage} />}
                <div>{articles[article].title}</div>
                <div>{articles[article].description}</div>
                <div>{articles[article].author}</div>
                <div>{articles[article].publishedAt}</div>
              </div>
            )
          })}
        </div>
      </section>
    </Layout>
  )
};



HomePage.getInitialProps = async () => {

  try {
    const res = await fetch('https://newsapi.org/v2/top-headlines?country=us&apiKey=d6fd84244a5240e49fbabded8f5ac2b3');
    const { status, articles } = await res.json();

    if (status === 'ok') {
      return articles;
    }
    return {};
  } catch (e) {
    console.log(e);
    return {};
  }
};

export default HomePage
